import React, { Component } from 'react'
import ServiceBanner from './service_banner'
import '../../layout/font-family/libra_franklin.css'
import MobileAppSection from './mobile_apps'
import DevlopProcess from './producDev'
import './service.css'
import JoinUs from '../GenericComponents/joinUs'

const title = 'Are you ready to start building your modern digital business?'
	const para = 'Cras habitant quisque pellentesque pellentesque aliquam.'
	const btntxt = 'Connect with us'


class service extends Component {

	componentDidMount() {
		document.title = this.props.title;
	}

    render() {
			return (
				<>
					{/* Service Banner Component */}
						<ServiceBanner/>
					{/* Service Banner End */}

					{/* Mobile App  Component */}
						<MobileAppSection/>
					{/* Mobile App End*/}

					{/* App Developement Component */}
						<DevlopProcess/>
					{/* App End */}

					{/* Common Component */}
						<JoinUs title={title} para={para} btntxt={btntxt}/>
					{/* Common Component end */}
				</>
			)
    }
}
